# Definition for an Intersection Node.
class INode(object):
    def __init__(self, x, y, z):
        self.x = x
        self.y = y
        self.z = z

    def __repr__(self):
        return str((self.x, self.y, self.z))

def get_intersections(nodes):
    """
    :type nodes: List[INode]
    :rtype: List[List[int]]
    """
    intersections = []
    for i in range(len(nodes)):
        node0 = nodes[i]
        for j in range(i+1, len(nodes)):
            node1 = nodes[j]
            if (node0.x == node1.x) and (node0.y == node1.y):
                intersections.append([node0.x, node0.y])
    return intersections

def is_valid(nodes):
    """
    :type nodes: List[INode]
    :rtype: bool
    """
    # Your code here
    intersection_list = get_intersections(nodes)
    for intersection in intersection_list:
        if not set(intersection).issubset({'a'}):
            return False
    return True

