from collections import defaultdict
class Solution(object):
    def findMaxForm(self, nums):
        """
        :type nums: List[List[str]]
        :rtype: List[List[str]]
        """
        # Write your code here
        if not nums: return []

        d = defaultdict(list)
        for i in range(len(nums)):
            d[nums[i][0]].append(nums[i])

        ans = []
        while len(ans) < 4:
            ans += self._dfs(d)

        return ans

    def _dfs(self, d):
        ans = []
        for k, v in d.items():
            if len(v) == 1:
                ans.append([k, *v[0]])
            else:
                for j in range(len(v)-1):
                    ans += self._dfs(defaultdict(list))
                    ans[-1].extend(v[:j+1])
                    ans[-1].extend(v[j+1:])
        return ans
